import { faCartShopping } from '@fortawesome/free-solid-svg-icons'
import Nav from 'react-bootstrap/Nav'

function CartWidget () {
    return(
        <Nav.Link href="Carrito" style={{"color": "white"}}><FontAwesomeIcon icon={ faCartShopping } style={{"width": "30px", "height": "30px"}}/></Nav.Link>
    )
}

export default CartWidget
